export const setMostPopular = (mostPopularBooks) => ({
  type: "SET_MOST_POPULAR_B",
  payload: mostPopularBooks,
});

export const setSearchedBooks = (books) => ({
  type: "SET_SEARCHED_BOOKS",
  payload: books,
});
